import React from 'react';

import './Menu.css';


const Menu = ({ onRouteChange }) => {
return (
  <div className="flex flex-column video-position" key='1'>
    <div className="w-50 vh-75 center " controls>
      <ul>
        <li>About</li>
        <li>Plans</li>
        <li>Contact</li>
        <li>Services</li>
      </ul>

    </div>
    <p
      className="f1 ttu center pointer orange br2 ba b--orange"
      onClick={()=> onRouteChange('home')}

      >Home</p>
  </div>
);

}

export default Menu;
